#
# TABLE STRUCTURE FOR: APARTAMENTO
#

DROP TABLE IF EXISTS `APARTAMENTO`;

CREATE TABLE `APARTAMENTO` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_SALON` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `COCINA_ELECTRICA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_PLANTAS` decimal(2,0) NOT NULL,
  `TIENE_ASCENSOR` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_HABITACIONES` int(1) NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `APARTAMENTO_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO_HOSPEDAJE` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



